(function($) {

    $(document).ready(function () {
        var webinarContainer = $('#courses-webinars');
        var feedUrl = 'https://www.edn.com/rss/eetimes/courses-webinars/';
        fetchWebinars(webinarContainer, feedUrl);
    });

    /**
     * Adds/Subtracts a number of hours from the date object
     *
     * @param {integer} hours the number of hours to add/subtract
     */
    Date.prototype.addHours = function (hours) {
        this.setTime(this.getTime() + (hours * 60 * 60 * 1000));
        return this;
    }

    /**
     * Function fills out a given container with the data fetched from a given feed URL
     * The container is within the HTML comment tags <!-- The Webinar plugin START/END --> in the index.html file
     *
     * @param {object} element - jQuery element which should contain the result
     * @param {string} url - URL which leads to the news feed
     */
    function fetchWebinars(element = $('#courses-webinars'), url = '') {
        if (element.length > 0 && url.length > 0) {

            var loader = `<div class="bubblingG">
                            <span id="bubblingG_1">
                            </span>
                            <span id="bubblingG_2">
                            </span>
                            <span id="bubblingG_3">
                            </span>
                         </div>`;
            element.html(loader);

            $.ajax({
                url: url,
                type: 'GET',
                dataType: 'xml',
                crossDomain: true,
                success: function (data) {
                    var items = $(data).find('item');
                    var result = '';

                    $(items).each(function () {
                        var link = $(this).find('link').text();
                        var title = $(this).find('title').text();
                        //Date is without an offset but it is always in EDT
                        var updated = moment.utc($(this).find('atom\\:updated').text());
                        //Compensating for EDT
                        updated.tz('America/New_York', true);

                        var description = $(this).find('description').text()
                        var image = $(this).find('enclosure').attr('url');

                        var row = '<div class="thumb">' +
                            '<a href="' + link + '">' +
                            '<img alt="' + title + '" src="' + image + '"/>' +
                            '</a>' +
                            '</div>' +
                            '<div class="desc">' +
                            '<h2>' +
                            '<a href="' + link + '">' + title + '</a>' +
                            '</h2>' +
                            '<h4>' + updated.format("dddd, MMM Do YYYY, h:mm A z") +
                            '</h4>' +
                            '<p class="excerpt">' + description + '</p>' +
                            '</div>';


                        row = '<div class="is-row"><div class="post-wrap box"><div class="details clearfix">' + row + '</div></div></div>';
                        result += row;
                    });
                    result = '<div class="section latest-tuts">' + result + '</div>';
                    element.html(result);
                },
                error: function (request, status, thrown) {
                    console.log(request.responseText);
                    console.log(status + ' - ' + thrown);
                }
            })

        } else if (element.length = 0 && window.console) {
            console.log('The provided jQuery element does not exist in the current document');
        } else if (url.length = 0 && window.console) {
            console.log('Please provide a valid URL');
        }
    }
})(jQuery);
